import TaskData from '../services/taskdata';
import Draw from '../common/drawer';
import LoginData from '../services/logindata';


const items = [
    {
        label: "Görevler",
        key: 'task',
        icon: <FileTextOutlined />
    },
    {
        label:"Görev Ekle",
        key:'task2',
        icon:<FileAddOutlined />
    },
    {
        label: "Takvim",
        key: 'calendar',
        icon: <CalendarOutlined />
    },
    {
        label: 'Mail',
        key: 'mail',
        icon: <MailOutlined />,
    },
    {
        label: 'Profil Düzenle',
                key: 'setting:1',
                icon: <SettingOutlined />,

    }



];

const Home = () => {
    const { formRef, handleLogin, isLoading,loggedInUser } = LoginData();

    return (
        <>
            <Draw loggedInUser={loggedInUser} itemsList={items}></Draw>
            <div style={{ marginLeft: "20px" }}>
                <h2>Home Page</h2>
                <p>Welcome to the Home Page!</p>
            </div>
            <TaskData></TaskData>



        </>


    );
};

export default Home;
